/*
 * Welcome to your Workbox-powered service worker!
 *
 * You'll need to register this file in your web app and you should
 * disable HTTP caching for this file too.
 * See https://goo.gl/nhQhGp
 *
 * The rest of the code is auto-generated. Please don't update this file
 * directly; instead, make changes to your Workbox build configuration
 * and re-run your build process.
 * See https://goo.gl/2aRDsh
 */
importScripts('https://storage.googleapis.com/workbox-cdn/releases/4.3.1/workbox-sw.js');

workbox.core.skipWaiting();
workbox.core.clientsClaim();

/**
 * The workboxSW.precacheAndRoute() method efficiently caches and responds to
 * requests for URLs in the manifest.
 * See https://goo.gl/S9QRab
 */

// added cache of index.html to lessen initial load on PWA
self.addEventListener('install', function(e) {
  const filesToCache = ['/index.html'];
  const cacheName = 'app-cache';
  e.waitUntil(
    caches.open(cacheName).then(function(cache) {
      return cache.addAll(filesToCache);
    })
  );
});

// @TODO: Check potential use of activate event
// self.addEventListener('activate', event => {
//   console.log('[ServiceWorker] V1 now ready to handle fetches!');
// });

workbox.routing.registerRoute(
  new RegExp('/|jpg|jpeg|png|html|js|css|woff|woff2|ttf'),
  new workbox.strategies.StaleWhileRevalidate({
    cacheName: 'app-cache',
  })
);

workbox.routing.registerRoute(({ url }) => url.pathname.indexOf('/api/') > -1, new workbox.strategies.NetworkFirst());

// catch offline api calls through service worker
self.addEventListener('fetch', event => {
  if (event.request.cache === 'only-if-cached' && event.request.mode !== 'same-origin') {
    return;
  }
  if (event.request.method === 'POST' || event.request.method === 'DELETE') {
    event.respondWith(
      fetch(event.request).catch(err => {
        console.error('REQUEST FAILED: Service worker response', err);
      })
    );
  }
});

self.__precacheManifest = [].concat(self.__precacheManifest || []);
workbox.precaching.precacheAndRoute(self.__precacheManifest || []);

const responseParser = response => {
  const type = response.type;
  const action = response.action;
  const data =
    typeof response.data === 'string' && response.data.length > 0 ? JSON.parse(response.data) : response.data;

  const getTitle = () => {
    if (data.profile.gender === 'Male') {
      return 'him';
    }

    return 'her';
  };

  const getPronoun = () => {
    if (data.profile.gender === 'Male') {
      return 'He';
    }

    return 'She';
  };

  const getMailAction = () => {
    if (data.profile.gender === 'Male') {
      return 'Your turn';
    }

    return "That's what she said";
  };

  const getOfferAction = () => {
    if (data.profile.account_type === 'Generous') {
      return 'Send a message';
    }

    return 'Unlock the conversation';
  };

  const getOfferNotification = () => {
    const isGenerous = data.profile.account_type === 'Generous';
    const userName = data.account.username;
    switch (action) {
      case 'receive':
        return {
          label: `${userName} sent you ${!isGenerous ? 'a request' : 'an offer'}!`,
          action: 'Check it out',
          link: `/profile/${data.account.hash_id}`,
        };
      case 'suggest':
        return {
          label: `${getPronoun()}'s interested!`,
          action: `Check ${getTitle()} out`,
          link: `/profile/${data.account.hash_id}`,
        };
      case 'accept':
        return {
          label: `${!isGenerous ? 'Offer' : 'Request'} Accepted!`,
          action: getOfferAction(),
          link: `/mail/${data.account.hash_id}`,
        };
    }
  };

  const getMailNotification = () => {
    switch (action) {
      case 'receive':
        return {
          label: 'New message!',
          action: getMailAction(),
          link: `/mail/${data.account.hash_id}`,
        };
      case 'unlock':
        return {
          label: 'Conversation Unlocked!',
          action: 'Send a message',
          link: `/mail/${data.account.hash_id}`,
        };
    }
  };

  const getFavoritedNotification = () => {
    switch (action) {
      case 'receive':
        return {
          label: `You've been favorited!`,
          action: `Check ${getTitle()} out`,
          link: `/profile/${data.account.hash_id}`,
        };
      default:
        break;
    }
  };

  const getWelcomeNotification = () => {
    return {
      label: 'Subscribed to Push Notifications',
      action: 'You can disable this in the settings',
      link: `/dashboard`,
    };
  };

  switch (type) {
    case 'favorites':
      return getFavoritedNotification();
    case 'offers':
      return getOfferNotification();
    case 'mail':
      return getMailNotification();
    case 'welcome':
      return getWelcomeNotification();
    default:
      return null;
  }
};

