});
*/

self.addEventListener('notificationclick', function(event) {
  event.notification.close();
  const urlToOpen = new URL(event.notification.data.link, self.location.origin);
  const promiseChain = clients
    .matchAll({
      type: 'window',
      includeUncontrolled: true,
    })
    .then(windowClients => {
      let matchingClient = null;

      for (let i = 0; i < windowClients.length; i++) {
        const windowClient = windowClients[i];
        const windowClientOrigin = new URL(windowClients[i], self.location.origin).origin;
        if (windowClientOrigin === urlToOpen.origin) {
          matchingClient = windowClient;
          break;
        }
      }

      if (matchingClient) {
        // For now, focus on same tab dashboard, push having issues if starting from other pages
        // because service worker registration is not called other than main screen
        return matchingClient.focus();

        // @TODO: research for a fix on calling service worker registration on other pages
        // return matchingClient.focus().then(client => client.navigate(urlToOpen.href));
      } else {
        return clients.openWindow(urlToOpen.origin);
      }
    });

  event.waitUntil(promiseChain);
});

self.addEventListener('push', event => {
  return clients.matchAll({ type: 'window' }).then(clients => {
    for (let i = 0; i < clients.length; ++i) {
      if (clients[i].visibilityState === 'visible') return; // there is a visible window
    }

    // continue with showing a notification
    if (event.data) {
      const eventJsonData = event.data.json();
      const responseData = responseParser(eventJsonData);
      const siteIcon =
        eventJsonData.site_id && eventJsonData.site_id === 'fd'
          ? 'https://s3.amazonaws.com/whatsyourprice/prod/fd/images/icons/FD_favicon_32x32.png'
          : 'https://dwytm1vo3v31f.cloudfront.net/icons/favicon.ico';
      if (responseData) {
        const promiseChain = self.registration
          .showNotification(responseData.label, {
            icon: siteIcon,
            body: responseData.action,
            tag: `notify-user-${Math.floor(Math.random() * 999)}`,
            data: {
              link: responseData.link,
            },
          })
          .then(() => {
            console.log('Notification Success');
          })
          .catch(error => {
            console.log('Something went wrong', error);
          });
        event.waitUntil(promiseChain);
      }
    }
  });
});
